import React, { useState } from 'react';

const ProductListPage = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const cars = [
        { id: 1, title: 'Tesla Model S', imageUrl: 'https://via.placeholder.com/400x250', description: 'Electric sedan with autopilot.' },
        { id: 2, title: 'Ford Mustang', imageUrl: 'https://via.placeholder.com/400x250', description: 'Classic muscle car with a powerful engine.' },
        { id: 3, title: 'Toyota Supra', imageUrl: 'https://via.placeholder.com/400x250', description: 'Sports car known for its speed.' },
    ];

    const filteredCars = cars.filter(car => car.title.toLowerCase().includes(searchTerm.toLowerCase()));

    return (
        <div className="container mx-auto py-10 px-6">
            <h1 className="text-4xl font-bold mb-8 text-gray-800 text-center">My Cars</h1>

            <div className="max-w-xl mx-auto mb-10">
                <input
                    type="text"
                    placeholder="Search cars..."
                    className="w-full p-4 border border-gray-300 rounded-lg shadow focus:outline-none focus:ring-2 focus:ring-blue-400"
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                />
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
                {filteredCars.map((car) => (
                    <div key={car.id} className="bg-white rounded-lg shadow-lg hover:shadow-2xl transform hover:scale-105 transition-all duration-300">
                        <img
                            src={car.imageUrl}
                            alt={car.title}
                            className="w-full h-56 object-cover rounded-t-lg"
                        />
                        <div className="p-6">
                            <h3 className="text-2xl font-semibold text-gray-800">{car.title}</h3>
                            <p className="text-gray-600 mt-2 mb-4">{car.description}</p>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default ProductListPage;
